import React from "react";
import Box from '@material-ui/core/Box';
import catSecurity from '../assets/catSecurity.mp4';

const ListPosts = () => {


  return (

      <video autoPlay loop muted 
      style={{position: "absolute", height: '100%', width: '100%', right: '50%', left: '50%', objectFit: "cover", transform: 'translate(-50%, -50%)', zIndex: '-1'}}>
        <source src={catSecurity} type='vide/mp4' />
      </video>

  )

}


export default ListPosts
